import React from "react";
import { Container, Row, Col } from "react-bootstrap";
import { FaFilm } from "react-icons/fa";

function BookTicket(props) {
  console.log(props.eventsList);
  return (
    <Container className="movie-details-wrap">
      <Row>
        <Col md={4}>
          <img src={props.movieDetails.imgsrc} alt="movie banner" />
        </Col>
        <Col md={8}>
          <h2 className="text-dark font-weight-bold">
            {props.movieDetails.name}
          </h2>
          <h5 className="font-italic font-weight-light text-dark">
            {props.movieDetails.tagline}
          </h5>
          <br />
          <h5 className="text-mute">
            Release Date: {props.movieDetails.releaseDate}
          </h5>
          <h5>
            <span className="text-mute">Duration : </span>
            <span className="text-danger">
              <FaFilm /> {props.movieDetails.runtime}
            </span>
          </h5>
        </Col>
        <hr className="w-100" />
      </Row>
      <div>
        {props.eventsList.map((event, index) => {
          return (
            <Row>
              <Col md={4}>Tanya</Col>
              <Col md={8}>Jain</Col>
            </Row>
          );
        })}
      </div>
    </Container>
  );
}

export default BookTicket;
